column8:
●名称：カレー<br>●内容量：200g（1人前）×6食入<br>●原材料名：野菜（玉ねぎ、にんじん、セロリ）、牛肉、ソテーオニオン、パインアップル、小麦粉、ワイン、豚脂、トマトペースト、ココナッツミルクパウダー、ビーフエキス、りんごペースト、カレー粉、パインアップル果汁、マンゴーペースト、食塩、チャツネ、ココナッツペースト、砂糖、デミグラスソース、香辛料、脱脂粉乳、バナナペースト、チキンエキス、調味料（アミノ酸等）、増粘剤、（加工でん粉）、酸味料、カラメル色素、香料<br>●殺菌方法：気密性容器に密封し、加圧加熱殺菌<br>●賞味期限：2018年4月7日<br>●保存方法：常温で保存してください。<br>●販売者：ハチ食品株式会社<table width="710"> <tbody> <tr> <td>

